import React, { useState } from "react";
import "./Dashboard.css";

function Dashboard() {
  const [selectedOption, setSelectedOption] = useState("");

  const renderContent = () => {
    switch (selectedOption) {
      case "EnterDetails":
        return <div>Enter Student Details Form</div>;
      case "ViewDetails":
        return <div>View Student Details Table</div>;
      case "DownloadReports":
        return <div>Download Reports Section</div>;
      default:
        return <div>Select an option from the Student menu.</div>;
    }
  };

  return (
    <div className="dashboard">
      <h4>Dashboard > {selectedOption || "Student"}</h4>
      {renderContent()}
    </div>
  );
}

export default Dashboard;
